import React from "react";

export default () => {
  return (
    <div>
      <div class="ui form">
        <div class="fields">
          <div class="field">
            <label>Name</label>
            <input type="text" placeholder="Name" />
          </div>
          <div class="field">
            <label>Age</label>
            <input type="number" placeholder="Age" />
          </div>
        </div>
      </div>
    </div>
  );
};
